import React, { useEffect, useState } from 'react'
import todoLogo from '../assests/TodoLogo.svg'

export default function Register() {

    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('')

    console.log(username)
    console.log(password)

    const handleUserChange = (event) => {
        setUsername(event.target.value)
    }

    const handlePasswordChange = (event) => {
        setPassword(event.target.value)
    }

    return (
        <div className='container'>
            <div className='form-container'>
                <img src={todoLogo} className='brand-logo' />
                <div className='brand-title'>Register</div>
                <div className='inputs'>
                    <label className='label'>Username</label>
                    <input className='username-input' onChange={handleUserChange} type='text' placeholder='Username' />
                    <label className='label'>Password</label>
                    <input className='password-input' onChange={handlePasswordChange} type='password' placeholder='Password' />
                    <input type='submit' className='submit-button' />
                </div>
            </div>
        </div>
    )
}
